#!/bin/sh
VIDEODIR=$1
OUTDIR=$2
while read line
do
    set -- $line
    YTID=$1
    STARTSEC=$2
    DURATION=$3
    YTFILENAME="v_${YTID}.mp4"
    FILENAME=$4
    if [ -e "$VIDEODIR/$YTFILENAME" ]; then
	ffmpeg -nostdin -loglevel warning -stats -i "$VIDEODIR/$YTFILENAME" -t $DURATION -ss $STARTSEC -y "$OUTDIR/$FILENAME"
    else
	echo "no file: $VIDEODIR/$YTFILENAME"
    fi
done << EOS
